import React from 'react';
import TaskToggle from "./TaskToggle/task-toggle";
import TaskButton from "./TaskButton/task-button";
import TaskLabel from "./TaskLabel/task-label";


const Task = ({label, className}) => {
    return <div className={className}>
                <TaskToggle className="toggle" type="checkbox"/>
                <TaskLabel label={label}/>
                <TaskButton className='icon icon-edit'/>
                <TaskButton className='icon icon-destroy'/>
        </div>
}

export default Task;
